import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css'

function Panel({children}){
    return(<div>{children}</div>)
}

function App(){
    return(
        <Panel>oui</Panel>
    )
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App></App>);
